a basic--but really important--
golf skill, so try your best.

Lesson 3: Swing Control{ T05_0000 }
The Swing Meter indicates
the power of your swing.

Here are two final
things to remember.{ T05_0000 }
First, make sure you take a
few { COMMON_FONT_COLOR 01 00 }practice swings{ COMMON_FONT_COLOR 00 00 } before
each shot.{ T05_0000 }
Swinging the Wii Remote
without holding  lets you
take a practice swing.{ T05_0000 }
Watch the Swing Meter to
monitor your swing power.{ T05_0000 }
Also, don't forget to correct
your stance before you swing.{ T05_0000 }
You can press  to
reposition yourself as many
times as you want.{ T05_0000 }
The basic rule is to
{ COMMON_FONT_COLOR 01 00 }position yourself facing
down{ COMMON_FONT_COLOR 00 00 } and press .{ T05_0000 }
